commit.message:
Fixes. (#501)

* Ability to white list namespaces to allow deployment of certain packs for some clouds.   The config is defined by json stored in CMS var 'PACK_CLOUD_NS_WHITELIST'.

* Fixed a bug for cost report on environment level (errored while generating report links).

* Added ability to diff two pack versions even when from different circuits and/or pack.

* Refactored Tekton integration:
 - CapacityProcessor with ability to plug a capacity provider, i.e. TektonClient;
 - generic processing of provider mappings for dynamic allocation of capacity resources;
 - ability to enable capacity manager for a list of namespaces;
 - more robust and reliable reservation management by utilizing namespaces when composing reservation ids;
 - utilized the Tekton bulk end-points;
 - improved tests.

* Deployment capacity pre-check.

* Fixes.

* Fix for capacity pre-check for deployments with add and delete WOs.

* Improvements to team/group members API end-points to enable using names in addition to IDs to identify entities.

